  

'use strict';

var Complex128 = require( '@stdlib/complex/float64/ctor' );
var randu = require( '@stdlib/random/base/randu' );
var cfloor = require( './../lib' );

var re;
var im;
var z;
var w;
var i;

for ( i = 0; i < 100; i++ ) {
	re = ( randu()*100.0 ) - 50.0;
	im = ( randu()*100.0 ) - 50.0;
	z = new Complex128( re, im );
	w = cfloor( z );
	console.log( 'floor(%s) = %s', z.toString(), w.toString() );
}
